import React, { useState }  from 'react'
// import { useInput } from './useInput/useInput'


const contents = [
    {
        name : 'HyoungBum',
        content : 'What is a sexy guy in the world'
    },
    {
        name : 'EunJi',
        content : 'what is a sexy girl in the world'
    }
]

const useTabs = (initialCurrentIndex, allTabs) => {
    const [currentIndex, setCurrentIndex] = useState(0);
    return {
        item: allTabs[currentIndex],
        setCurrentIndex: setCurrentIndex
    }
}
function App() {
    return (
        <>
            <div>
                {contents.map((person, index) => <button onClick={() => setCurrentIndex(index)}>{person.name}</button>)}
            </div>
        </>
    );
}

export default App;
